import React from "react";
import { useLocation } from "react-router-dom";
import "../styles/DetalhesImovel.css";

const DetalhesImovel = () => {
  const location = useLocation();
  const {
    type = "Residencial",
    rooms = 2,
    area = 200,
    address = "Cajazeiras - Paraíba - Brazil",
    owner = { name: "Marcos Santos", email: "marcos.santos@gmail.com" },
    realtor = {
      name: "Joãozinho da Costa",
      email: "joaozinho.costa@gmail.com",
      contact: "83999999999",
    },
  } = location.state || {};

  return (
    <div className="detalhes-imovel">
      <header className="header">
        <h1>Easy Imóveis</h1>
      </header>

      <div className="content">
        {/* Dados do Imóvel */}
        <section className="dados-imovel">
          <h2>Dados do Imóvel</h2>
          <div className="imovel-info">
            <div>
              <p><strong>País:</strong> Brasil</p>
              <p><strong>Estado:</strong> Paraíba</p>
              <p><strong>Cidade:</strong> Cajazeiras</p>
            </div>
            <div>
              <p><strong>Área:</strong> {area} m²</p>
              <p><strong>Cômodos:</strong> {rooms}</p>
              <p><strong>Tipo:</strong> {type}</p>
            </div>
          </div>
        </section>

        {/* Dados do Proprietário */}
        <section className="proprietario">
          <h2>Proprietário</h2>
          <p><strong>Nome:</strong> {owner.name}</p>
          <p><strong>Email:</strong> {owner.email}</p>
        </section>

        {/* Dados do Corretor */}
        <section className="corretor">
          <h2>Corretor</h2>
          <p><strong>Nome:</strong> {realtor.name}</p>
          <p><strong>Email:</strong> {realtor.email}</p>
          <p><strong>Contato:</strong> {realtor.contact}</p>
        </section>

        {/* Botão de Ação */}
        <div className="action">
          <button className="btn btn-primary">Continuar Compra</button>
        </div>
      </div>
    </div>
  );
};

export default DetalhesImovel;
